import React from 'react';

import Link from './Link/Link';

import classes from './Links.module.css';

const Links = () => (
    <div className={classes.Links}>
        <Link>Link1</Link>
        <Link>Link2</Link>
        <Link>Link3</Link>
    </div>
);

export default Links;
